(1, 'من نحن', 'About Us', '<h4 style=\"text-align: justify;\">رؤيتنا</h4>\r\n<p style=\"text-align: justify;\">أن نصبح الشركة الرائدة في هذا المجال على مستوى الشرق الأوسط والمستوي العالمي من خلال الاستفادة من الأفكار المتميزة، ونحن نعمل على تقديم حلول فريدة لعملائنا الكرام لتكون مطابقة لتوقعاتهم من خلال تقديم الخدمات الفعالة.أن نصبح الشركة الرائدة في هذا المجال على مستوى الشرق الأوسط والمستوي العالمي من خلال الاستفادة من الأفكار المتميزة، ونحن نعمل على تقديم حلول فريدة لعملائنا الكرام لتكون مطابقة لتوقعاتهم من خلال تقديم الخدمات الفعالة.</p><p style=\"text-align: justify;\"><br></p>\r\n<h4 style=\"text-align: justify;\">رسالتنا</h4>\r\n<p style=\"text-align: justify;\">رسالتنا هي تمكين عملائنا من تطوير أعمالهم من خلال الأفكار المتميزة، وتقديم الاستشارات الموثوقة والخدمة عالية الجودة، بالإضافة إلى تأسيس مكان رائع نعمل من أجله والذي يجذب الأشخاص المميزين ويعمل على تطويرهم والاحتفاظ بهم.رسالتنا هي تمكين عملائنا من تطوير أعمالهم من خلال الأفكار المتميزة، وتقديم الاستشارات الموثوقة والخدمة عالية الجودة، بالإضافة إلى تأسيس مكان رائع نعمل من أجله والذي يجذب الأشخاص المميزين ويعمل على تطويرهم والاحتفاظ بهم.</p><p style=\"text-align: justify;\"><br></p>\r\n<h4 style=\"text-align: justify;\">فريق العمل</h4>\r\n<p style=\"text-align: justify;\">إن فريق عملنا متنوع ونتفاعل مع بعضنا البعض باحترام متبادل بغض النظر عن الجنس أو الجنسية أو الدين أو العرق، كما نثق في بعضنا البعض ونؤمن بالعدالة والشفافية، نحن نخلق بيئة تعزز التعاون و الإنجازات المتميزة.إن فريق عملنا متنوع ونتفاعل مع بعضنا البعض باحترام متبادل بغض النظر عن الجنس أو الجنسية أو الدين أو العرق، كما نثق في بعضنا البعض ونؤمن بالعدالة والشفافية، نحن نخلق بيئة تعزز التعاون و الإنجازات المتميزة.</p>', '<section class=\"u-black u-clearfix u-section-1\" id=\"carousel_e0de\">\r\n      <div class=\"u-clearfix u-sheet u-sheet-1\">\r\n        <div class=\"u-clearfix u-expanded-width u-layout-wrap u-layout-wrap-1\">\r\n          <div class=\"u-layout\">\r\n            <div class=\"u-layout-row\">\r\n              <div class=\"u-align-center u-container-style u-image u-layout-cell u-size-30 u-image-1\" data-image-width=\"1200\" data-image-height=\"1200\">\r\n                <div class=\"u-container-layout u-container-layout-1\"></div>\r\n              </div>\r\n              <div class=\"u-align-left u-black u-container-style u-layout-cell u-size-30 u-layout-cell-2\">\r\n                <div class=\"u-container-layout u-valign-middle-xs u-container-layout-2\">\r\n                  <p class=\"u-text u-text-body-alt-color u-text-1\"> From the humble beginnings of our initial meshes for\r\nindustries, we have come a long way. With a history since 1970, we have been\r\nmanufacturing the finest woven meshes with various materials.<br>\r\n                    <br>Products know no bounds, today our meshes are crafted for various art and deco applciations. The designs are a\r\ncollaborative effort of many minds who have broken paradigms to design and\r\ncreate new patterns.&nbsp;<br>\r\n                    <br>This thought and the intent to always craft with the very\r\nbest in class materials has helped decoMESH come a long way. \r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <h4 class=\"u-custom-font u-font-playfair-display u-text u-text-grey-5 u-text-2\">about</h4>\r\n      </div>\r\n    </section>\r\n    <section class=\"u-align-center u-clearfix u-section-2\" id=\"carousel_76a1\">\r\n      <div class=\"u-clearfix u-sheet u-sheet-1\">\r\n        <div class=\"u-expanded-width-xs u-image u-image-circle u-image-1\" data-image-width=\"500\" data-image-height=\"750\"></div>\r\n        <div class=\"u-container-style u-expanded-width u-grey-10 u-group u-shape-rectangle u-group-1\">\r\n          <div class=\"u-container-layout u-valign-middle-lg u-valign-middle-md u-valign-middle-sm u-valign-middle-xl u-container-layout-1\">\r\n            <h2 class=\"u-text u-text-1\">The begining of decoMESH</h2>\r\n          </div>\r\n        </div>\r\n        <p class=\"u-text u-text-2\">\r\n          <br>The group behind decoMESH has been in the weaving industry for 55+ years dedicated to servicing and enhancing customer satisfaction.&nbsp;<br>This even won the group the CII \"Customer Obsession Award in 2019 &amp; 2020\"<br>This offshute is an endivor to satify the inner creative in us all.&nbsp;\r\n        </p>\r\n      </div>\r\n    </section>', '2017-03-06', NULL, NULL, NULL, NULL, '', NULL, NULL, 1, 691, 1, 0, 1, 'عن الموقع', 'About Us', 'وصف الصفحة الخاصة بمن نحن ليساعد على الأرشفة', 'Page description for good SEO', 'من نحن، نبذة عنا، وصف الموقع، كلمات ، دلالية', 'About, who us, kewords, About Us', NULL, 'about-1', 1, 2, '2017-03-05 18:36:24', '2021-12-16 01:56:07'),
