(56, NULL, 'What\'s in a Mesh?', NULL, '<div dir=\"ltr\"><span style=\"color: rgb(17, 17, 17); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Traditional wire meshs are </span><span style=\"box-sizing: border-box; color: rgb(17, 17, 17); font-family: \"Open Sans\", sans-serif; font-size: 16px;\"><span style=\"box-sizing: border-box;\">boring, common and un-unique</span>. </span><span style=\"color: rgb(17, 17, 17); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">decoMESH aims to bring design first, carefully crafted meshes at your disposal. The creative minds of the industry have helped inspire numerous patters and material combinations to bring to you a range of exclusive and truly unique meshesfor interior and exteior applications.</span><br></div>', '2021-08-18', NULL, NULL, '16333299806359.jpg', '16333298878886.mp4', NULL, NULL, NULL, 1, 44, 1, 0, 7, NULL, 'What\'s in a Mesh?', NULL, 'Traditional wire meshs are boring, common and un-unique. decoMESH aims to bring design first, carefully crafted meshes at your disposal. The creative minds', NULL, NULL, NULL, 'whats-in-a-mesh', 2, 1, '2021-08-17 18:31:54', '2021-12-16 08:08:25'),
(57, NULL, 'Our Ethos', NULL, '<div dir=\"ltr\"><span style=\"color: rgb(17, 17, 17); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Design and wire mesh have seldom coincided. Our aim is to make sure they are thought as one. Using uncommon materials, we aim to create uncommon meshes for unique applications. Our products are crafted with one aim, to highlight the subtle aspects of design and showcase the creative genius in its designer.   </span><br style=\"box-sizing: border-box; color: rgb(17, 17, 17); font-family: \"Open Sans\", sans-serif; font-size: 16px;\"><br style=\"box-sizing: border-box; color: rgb(17, 17, 17); font-family: \"Open Sans\", sans-serif; font-size: 16px;\"><span style=\"color: rgb(17, 17, 17); font-family: \"Open Sans\", sans-serif; font-size: 16px;\"> Design on, let the Mesh talk.. </span><br></div>', '2021-08-18', NULL, NULL, '16292885394992.jpeg', NULL, NULL, NULL, NULL, 1, 33, 1, 0, 8, NULL, 'Our Ethos', NULL, 'Design and wire mesh have seldom coincided. Our aim is to make sure they are thought as one. Using uncommon materials, we aim to create uncommon meshes for unique ap', NULL, NULL, NULL, 'our-ethos', 2, 2, '2021-08-17 18:32:26', '2021-12-18 05:12:38'),
(58, NULL, 'Weaving Designs', NULL, '<div dir=\"ltr\"><span style=\"color: rgb(17, 17, 17); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Choose from a vast varity of designs created with various materials. Using special weave paterns and wire combinations to really bring the design to life.  Each mesh is desgined keeping in mind its asthetics and durability. The meshes are also designed for various applications it may be used for, as a simple plug and play solution. </span><br></div>', '2021-08-18', NULL, NULL, '16292885817512.jpg', NULL, NULL, NULL, NULL, 1, 29, 1, 0, 9, NULL, 'Weaving Designs', NULL, 'Choose from a vast varity of designs created with various materials. Using special weave paterns and wire combinations to really bring the design to life.&nbsp; Each', NULL, NULL, NULL, 'weaving-designs', 2, 2, '2021-08-17 18:32:55', '2021-12-16 21:24:10'),
(59, NULL, 'HAVE A SEAT', NULL, '<div dir=\"ltr\"><span style=\"color: rgb(17, 17, 17); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\">We want to work with you to bring your spaces and designs to life. We have a dedicated design team specializing in pushing boundaries to create new designs and weave patterns. </span><br></div>', '2021-08-18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 0, 10, NULL, 'HAVE A SEAT', NULL, 'We want to work with you to bring your spaces and designs to life. We have a dedicated design team specialzing in pushing boundries to create new designs and weave p', NULL, NULL, NULL, 'have-a-seat', 2, 1, '2021-08-17 18:33:48', '2021-08-26 03:27:31'),
